Let's denote D as the number of dogs, C as the number of cats, R as the number of rabbits, P as the total number of pets (Dogs+Cats+Rabbits). We know three things according to your question; 

  1) Rabbit Pet Count(R)= Dog Count(D)+Cat count(C)-12
  2) Cat counts per dog= 2 which means Cat Count(C)=2*Dog Count(D), since we already know the Number Of Dogs i.e., 8534066
Substitute this information into our first equation it becomes;

   R = 8534066+2*(8534066)-12 => R = 3·8534066–12                      // Here I am using distributive property & combining like terms
     --> Hence Total Rabbit pet count or 'R' would equal : **2,560,0598**
Next calculating cat count ('C') , we get ;
         -> C = 2×dog_count() ----> Substituting known

